import React from "react"


import Topo from "../Topo";
import Rodape from "../Rodape";

const EstruturaPagina = ( props ) => {
    return(
        <section>
            <Topo />

            {props.children}

            <Rodape />
        </section>
    )
}
export default EstruturaPagina;
